import React from 'react'
export default function Buttoni({first,text1,text2,text3,functions}) {
    return (
        <>
            <div className={'bot'}>
                <p>{first}</p>
                <button className={'button'} onClick={functions}>{text1}</button>
                <button className={'button'}>{text2}</button>
                <button className={'button'}>{text3}</button>
            </div>
        </>

    )

}
